import React from 'react'

function Card_props() {
  return (
    <div className='col-3'>
        <div className="card" style={{width: '19rem', height:'10rem'}}>
  <img src="https://assets-in.bmscdn.com/iedb/movies/images/mobile/thumbnail/xlarge/de-de-pyaar-de-2-et00391156-1760180159.jpg" className="card-img-top" alt="..." />
  <div className="card-body">
    <h5 className="card-title">Card title</h5>
    <p className="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
    <a href="#" className="btn btn-primary">Go somewhere</a>
  </div>
</div>

</div>

  );
}

export default Card_props
